-- ----------------------------
-- Table structure for mk_customer
-- ----------------------------
DROP TABLE IF EXISTS `mk_customer`;
CREATE TABLE `mk_customer`  (
  `customer_id` bigint(20) NOT NULL COMMENT '客户ID（雪花ID）',
  `customer_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '客户企业名称（如“XX科技有限公司”）',
  `customer_short_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '客户简称（如“XX科技”）',
  `lead_id` bigint(20) NULL DEFAULT NULL COMMENT '来源线索ID（关联mk_lead.lead_id，线索转化时填充）',
  `source_type` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '客户来源（关联字典：mk_customer_source；0-线索转化/1-直接录入/2-合作伙伴推荐）',
  `industry_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属行业（关联字典：sys_company_industry；与线索表行业字典统一）',
  `customer_level` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '3' COMMENT '客户等级（关联字典：mk_customer_level；0-战略客户/1-重要客户/2-普通客户/3-潜在客户）',
  `cooperation_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '合作状态（关联字典：mk_cooperation_status；0-未合作/1-合作中/2-已终止）',
  `scale_type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业规模（关联字典：sys_company_scale；与线索表统一）',
  `region` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属区域（如“华东-上海”，关联字典：sys_region）',
  `address` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '详细地址',
  `legal_person` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '法定代表人',
  `registered_capital` decimal(16, 2) NULL DEFAULT NULL COMMENT '注册资本（万元）',
  `establish_date` date NULL DEFAULT NULL COMMENT '成立日期',
  `website` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业官网',
  `phone` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业电话',
  `email` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业邮箱',
  `tax_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '纳税人识别号',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '客户描述（如“主营RFID标签生产，年采购量约100万”）',
  `assign_user_id` bigint(20) NOT NULL COMMENT '负责人ID（关联sys_user.user_id）',
  `assign_dept_id` bigint(20) NULL DEFAULT NULL COMMENT '所属部门ID（关联sys_dept.dept_id）',
  `attachment_ids` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '附件IDs（关联sys_attachment.attachment_id，逗号分隔）',
  `del_flag` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '删除标记（0-正常/1-删除）',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '创建人（关联sys_user.username）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '更新人（关联sys_user.username）',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `reserved1` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '预留字段1（如“客户编码”）',
  `reserved2` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '预留字段2（如“特殊合作条款”）',
  `reserved3` bigint(20) NULL DEFAULT NULL COMMENT '预留字段3（如“关联母公司ID”）',
  PRIMARY KEY (`customer_id`) USING BTREE,
  UNIQUE INDEX `uk_customer_name`(`customer_name`) USING BTREE COMMENT '客户名称唯一，避免重复录入',
  INDEX `idx_cooperation_status`(`cooperation_status`) USING BTREE COMMENT '按合作状态筛选（如“合作中”客户）',
  INDEX `idx_customer_level`(`customer_level`) USING BTREE COMMENT '按客户等级筛选（如“战略客户”）',
  INDEX `idx_assign_user_dept`(`assign_user_id`, `assign_dept_id`) USING BTREE COMMENT '按负责人+部门筛选',
  INDEX `idx_lead_id`(`lead_id`) USING BTREE COMMENT '按来源线索ID追溯（线索转化的客户）',
  INDEX `idx_region_industry`(`region`, `industry_type`) USING BTREE COMMENT '按区域+行业筛选（如“华东-制造业”客户）'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '客户主表（存储企业客户核心信息）' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of mk_customer
-- ----------------------------

-- ----------------------------
-- Table structure for mk_customer_contact
-- ----------------------------
DROP TABLE IF EXISTS `mk_customer_contact`;
CREATE TABLE `mk_customer_contact`  (
  `contact_id` bigint(20) NOT NULL COMMENT '联系人ID（雪花ID）',
  `customer_id` bigint(20) NOT NULL COMMENT '客户ID（关联mk_customer.customer_id）',
  `contact_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '联系人姓名',
  `position` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '职位（如“采购经理”“技术总监”）',
  `phone` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '手机号（唯一，避免重复）',
  `email` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '邮箱',
  `is_primary` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否主联系人（0-否/1-是，一个客户只能有一个主联系人）',
  `gender` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '性别（1-男/2-女）',
  `birthday` date NULL DEFAULT NULL COMMENT '生日',
  `wechat` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微信号',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注（如“决策人，偏好邮件沟通”）',
  `del_flag` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '删除标记（0-正常/1-删除）',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '创建人',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '更新人',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`contact_id`) USING BTREE,
  UNIQUE INDEX `uk_phone`(`phone`) USING BTREE COMMENT '手机号唯一，避免重复联系人',
  INDEX `idx_customer_id`(`customer_id`) USING BTREE COMMENT '按客户ID查询所有联系人',
  INDEX `idx_is_primary`(`is_primary`) USING BTREE COMMENT '快速筛选主联系人',
  CONSTRAINT `fk_contact_customer` FOREIGN KEY (`customer_id`) REFERENCES `mk_customer` (`customer_id`) ON DELETE CASCADE ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '客户联系人表（存储客户的多个联系人信息）' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of mk_customer_contact
-- ----------------------------

-- ----------------------------
-- Table structure for mk_lead
-- ----------------------------
DROP TABLE IF EXISTS `mk_lead`;
CREATE TABLE `mk_lead`  (
  `lead_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '线索ID',
  `lead_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '线索名称',
  `phone` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '联系电话',
  `email` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '电子邮箱',
  `source_id` bigint(20) NOT NULL COMMENT '线索来源ID',
  `lead_status` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '线索状态：0-新线索 1-已分配 2-已失效',
  `assign_to` bigint(20) NULL DEFAULT NULL COMMENT '负责人ID',
  `level` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '1' COMMENT '线索等级：1-高 2-中 3-低',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '地址',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '线索描述',
  `create_by` bigint(20) NOT NULL COMMENT '创建者',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) NULL DEFAULT NULL COMMENT '更新者',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '0' COMMENT '删除标志：0-正常 1-删除',
  PRIMARY KEY (`lead_id`) USING BTREE,
  UNIQUE INDEX `uk_phone`(`phone`, `del_flag`) USING BTREE,
  UNIQUE INDEX `uk_email`(`email`, `del_flag`) USING BTREE,
  INDEX `idx_lead_create_by`(`create_by`) USING BTREE,
  INDEX `idx_lead_assign_to`(`assign_to`) USING BTREE,
  INDEX `idx_lead_source_id`(`source_id`) USING BTREE,
  INDEX `idx_lead_status`(`lead_status`) USING BTREE,
  INDEX `idx_lead_create_time`(`create_time`) USING BTREE,
  INDEX `idx_lead_del_flag`(`del_flag`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '线索表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of mk_lead
-- ----------------------------

-- ----------------------------
-- Table structure for mk_lead_assign
-- ----------------------------
DROP TABLE IF EXISTS `mk_lead_assign`;
CREATE TABLE `mk_lead_assign`  (
  `assign_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '分配记录ID',
  `lead_id` bigint(20) NOT NULL COMMENT '线索ID',
  `old_user_id` bigint(20) NULL DEFAULT NULL COMMENT '原负责人ID',
  `new_user_id` bigint(20) NOT NULL COMMENT '新负责人ID',
  `assign_type` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '分配类型：0-自动分配 1-手动分配 2-转交 3-收回',
  `assign_reason` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '分配原因',
  `assign_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '分配时间',
  `create_by` bigint(20) NOT NULL COMMENT '操作者ID',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`assign_id`) USING BTREE,
  INDEX `idx_assign_lead_id`(`lead_id`) USING BTREE,
  INDEX `idx_assign_new_user_id`(`new_user_id`) USING BTREE,
  INDEX `idx_assign_old_user_id`(`old_user_id`) USING BTREE,
  INDEX `idx_assign_time`(`assign_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 52 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '线索分配表' ROW_FORMAT = Dynamic;

